import React, { Component } from 'react';
import Navbar from './components/layout/Navbar';
import Users from './components/users/users';
import './App.css';

class App extends Component{
  render () {
    return (
      <div className='app'>
          <Navbar />
          <Users />
      </div>
    )
  }
}
export default App;
